let fossilModel: Array<Array<String>> = [["三葉蟲", "trilobite", "さんようちゅう", "1300", "三葉蟲啊，是比恐龍時代更早的生物。因為已經進行了大量的研究，所以現在已成為確定地層年代的標準了哦！無論是種類還是大小都很豐富，最大的有60厘米左右……長得像蟲子一樣，說實話我很怕……", "https://patchwiki.biligame.com/images/dongsen/thumb/2/20/mecpjuuyn7qvkpo0krnjkbw07y2mlvt.png/120px-%E3%81%95%E3%82%93%E3%82%88%E3%81%86%E3%81%A1%E3%82%85%E3%81%86.png.jpeg"], ["三角龍的頭", "tricera skull", "トリケラトプスのあたま", "5500", "三角龍啊，是生活到恐龍時代最後期的食草恐龍。 3隻角和大大的頸盾是它的特徵，但實際上，這個頸盾，是發達的顎部肌肉......它的咬合力，是周圍其他食肉恐龍遠不能及的哦！ ", "https://patchwiki.biligame.com/images/dongsen/d/d6/t9mvhdhzc4jyk24rwy0b0t595xjlfh1.png"], ["三角龍的尾巴", "tricera tail", "トリケラトプスのしっぽ", "4500", "三角龍啊，是生活到恐龍時代最後期的食草恐龍。 3隻角和大大的頸盾是它的特徵，但實際上，這個頸盾，是發達的顎部肌肉......它的咬合力，是周圍其他食肉恐龍遠不能及的哦！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/c/ca/qdp6ip3zajk06gr5tmfj21w58zeinxm.png/120px-%E3%83%88%E3%83%AA%E3%82%B1%E3%83%A9%E3%83%88%E3%83%97%E3%82%B9%E3%81%AE%E3%81%97%E3%81%A3%E3%81%BD.png.jpeg"], ["三角龍的身體", "tricera torso", "トリケラトプスのからだ", "5000", "三角龍啊，是生活到恐龍時代最後期的食草恐龍。 3隻角和大大的頸盾是它的特徵，但實際上，這個頸盾，是發達的顎部肌肉......它的咬合力，是周圍其他食肉恐龍遠不能及的哦！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/8/8e/1y9ebc98w45bhva1d56zyyhlp9wpy15.png/120px-%E3%83%88%E3%83%AA%E3%82%B1%E3%83%A9%E3%83%88%E3%83%97%E3%82%B9%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["豐嬌昆明魚", "myllokunmingia", "ミロクンミンギア", "1500", "豐嬌昆明魚啊，據說是生活在比恐龍更早時期的更古老的魚類。大小約莫3厘米，乍一看不是很清楚……但鰓和鰭一應俱全！畢竟那是個充滿謎團的時代，將來或許還會出現更加古老的生物呢……", "https://patchwiki.biligame.com/images/dongsen/thumb/d/d9/3pbqgy6dez4n3m9q1qp7a03qok461wm.png/120px-%E3%83%9F%E3%83%AD%E3%82%AF%E3%83%B3%E3%83%9F%E3%83%B3%E3%82%AE%E3%82%A2.png"], ["侏羅獸", "juramaia", "ジュラマイア", "1500", "侏羅獸啊，據說是生活在恐龍時代的早期哺乳類生物。為了躲避擁有強大力量的恐龍，身體很小，連10厘米都沒有。也有說法，直至恐龍滅絕為止，哺乳類都是夜行性的。為了與身長可達幾十米的恐龍們共存，需要花很多功夫呢。 ", "https://patchwiki.biligame.com/images/dongsen/e/ef/i19miysvjik5izag2jr5anhwjcqycdd.png"], ["劍齒虎的頭", "sabertooth skull", "スミロドンのあたま", "2500", "劍齒虎啊，就像它的名字一樣，擁有劍一樣的巨大犬齒，是貓的同類！那鋒利的牙齒會在成年後達到20厘米以上！咦~~ 一萬年前滅絕了，原因是食物不足……據說是因為，它的食物長毛象因為氣候變化而滅絕了……", "https://patchwiki.biligame.com/images/dongsen/thumb/e/e5/7m8gq6v66kj1tceov98zjgnvi8frogh.png/120px-%E3%82%B9%E3%83%9F%E3%83%AD%E3%83%89%E3%83%B3%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["劍齒虎的身體", "sabertooth tail", "スミロドンのからだ", "2000", "劍齒虎啊，就像它的名字一樣，擁有劍一樣的巨大犬齒，是貓的同類！那鋒利的牙齒會在成年後達到20厘米以上！ （咦~~）一萬年前滅絕了，原因是食物不足……據說是因為，它的食物長毛象因為氣候變化而滅絕了……", "https://patchwiki.biligame.com/images/dongsen/thumb/6/68/szuvj6uw4z021ysjuth2ju12clvczh2.png/120px-%E3%82%B9%E3%83%9F%E3%83%AD%E3%83%89%E3%83%B3%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["劍龍的頭", "stego skull ", "ステゴサウルスのあたま", "5000", "劍龍啊，出現在恐龍時代的中期。背部那菱形的鰭，其實是骨頭組成的……主要功能是像大象的耳朵一樣，用來讓身體保持涼爽。不止是外型很酷，同時還具備功能性，真是很了不起呢！ ", "https://patchwiki.biligame.com/images/dongsen/d/de/piewt5iioqc1xz9wbjc79vqoe0y8vur.png"], ["劍龍的尾巴", "stego tail", "ステゴサウルスのしっぽ", "4000", "劍龍啊，出現在恐龍時代的中期。背部那菱形的鰭，其實是骨頭組成的……主要功能是像大象的耳朵一樣，用來讓身體保持涼爽。不止是外型很酷，同時還具備功能性，真是很了不起呢！ ", "https://patchwiki.biligame.com/images/dongsen/8/8c/7ltdux1k1piz84pk2qrcwf3b9u2h9lk.png"], ["劍龍的身體", "stego torso", "ステゴサウルスのからだ", "4500", "劍龍啊，出現在恐龍時代的中期。背部那菱形的鰭，其實是骨頭組成的……主要功能是像大象的耳朵一樣，用來讓身體保持涼爽。不止是外型很酷，同時還具備功能性，真是很了不起呢！ ", "https://patchwiki.biligame.com/images/dongsen/3/3c/ny2kywz069zzwbqm9br3fex5ct8o95s.png"], ["副櫛龍的頭", "parasaur skull", "パラサウロロフスのあたま", "3500", "副櫛龍啊，出現在恐龍時代的最後。頭部的冠是1米長的中空骨頭，據說它會通過這骨頭髮出叫聲。會是怎樣的聲音呢？光是想想就激動不已呢！ ", "https://patchwiki.biligame.com/images/dongsen/7/7c/l0ym0nen9ma7k5jw4hm65lpgrw8yucf.png"], ["副櫛龍的尾巴", "parasaur tail", "パラサウロロフスのしっぽ", "2500", "副櫛龍啊，出現在恐龍時代的最後。頭部的冠是1米長的中空骨頭，據說它會通過這骨頭髮出叫聲。會是怎樣的聲音呢？光是想想就激動不已呢！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/e/e7/60o3fi1ncmk5fg612ohwa23ejvucuob.png/120px-%E3%83%91%E3%83%A9%E3%82%B5%E3%82%A6%E3%83%AD%E3%83%AD%E3%83%95%E3%82%B9%E3%81%AE%E3%81%97%E3%81%A3%E3%81%BD.png.jpeg"], ["副櫛龍的身體", "parasaur torso", "パラサウロロフスのからだ", "3000", "副櫛龍啊，出現在恐龍時代的最後。頭部的冠是1米長的中空骨頭，據說它會通過這骨頭髮出叫聲。會是怎樣的聲音呢？光是想想就激動不已呢！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/6/69/size8ku4mzbof07vq0tbrlldl8qjb3a.png/120px-%E3%83%91%E3%83%A9%E3%82%B5%E3%82%A6%E3%83%AD%E3%83%AD%E3%83%95%E3%82%B9%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["南方古猿", "australopith", "アウストラロピテクス", "1100", "南方古猿啊，是大約出現於400萬年前，介於人與猿之間的人類。比現代人的祖先更早存在，雖然知道兩者之間並沒有直接聯繫……但不管怎麼說，人類不就是從這時候開始變得與其他生物完全不同的嗎？ ", "https://patchwiki.biligame.com/images/dongsen/2/28/gxbn7bnki56s5cl1kiose9d4pfkwz1n.png"], ["厚頭龍的頭", "pachy skull", "パキケファロのあたま", "4000", "厚頭龍啊，被認為存活到了恐龍時代的最後。圓圓的頭部很有特點，那裡的骨頭厚度好像達到了30厘米吧？ ！因為臉並不是很大，所以相應的，腦部會很小吧。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/2/20/1sm1dnc662yde9gocsh0c6k6vz8h76p.png/120px-%E3%83%91%E3%82%AD%E3%82%B1%E3%83%95%E3%82%A1%E3%83%AD%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["厚頭龍的身體", "pachy torso", "パキケファロのからだ", "3500", "厚頭龍啊，被認為存活到了恐龍時代的最後。圓圓的頭部很有特點，那裡的骨頭厚度好像達到了30厘米吧？ ！因為臉並不是很大，所以相應的，腦部會很小吧。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/a/aa/4lo6ds900ebqxmzr0m4ey9ky6d51rju.png/120px-%E3%83%91%E3%82%AD%E3%82%B1%E3%83%95%E3%82%A1%E3%83%AD%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["雙葉鈴木龍的頭", "plesio skull", "フタバサウルスのあたま", "4000", "雙葉鈴木龍啊，出現在恐龍時代的末期。和棲息在海裡的蛇頸龍同樣是爬行動物。正如其名，脖子像蛇一樣長長的，手腳附有鰭是它的特徵。順便說一下……因為是由一位名叫“鈴木”的人發現的，學名就被命名為“雙葉鈴木龍”了。鈴木發現化石時還是高中生，到最終命名為止經過了30多年……在考古學的世界裡，發掘當然不用說，要證明新發掘的東西是否與現存的都不同，也是一樁很辛苦的事情哦~嗯，大部分的研究者在證明方面都有自己擅長的領域！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/1/15/g4bv6ndivb65csrc81v5cw9t7etpbnm.png/120px-%E3%83%95%E3%82%BF%E3%83%90%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["雙葉鈴木龍的尾巴", "plesio tail", "フタバサウルスのしっぽ", "4500", "雙葉鈴木龍啊，出現在恐龍時代的末期。和棲息在海裡的蛇頸龍同樣是爬行動物。正如其名，脖子像蛇一樣長長的，手腳附有鰭是它的特徵。順便說一下……因為是由一位名叫“鈴木”的人發現的，學名就被命名為“雙葉鈴木龍”了。鈴木發現化石時還是高中生，到最終命名為止經過了30多年……在考古學的世界裡，發掘當然不用說，要證明新發掘的東西是否與現存的都不同，也是一樁很辛苦的事情哦~嗯，大部分的研究者在證明方面都有自己擅長的領域！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/8/88/pxqzhdevig0oxa2562jtl7mwsnx3gi0.png/120px-%E3%83%95%E3%82%BF%E3%83%90%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%97%E3%81%A3%E3%81%BD.png.jpeg"], ["雙葉鈴木龍的身體", "plesio body", "フタバサウルスのからだ", "4500", "雙葉鈴木龍啊，出現在恐龍時代的末期。和棲息在海裡的蛇頸龍同樣是爬行動物。正如其名，脖子像蛇一樣長長的，手腳附有鰭是它的特徵。順便說一下……因為是由一位名叫“鈴木”的人發現的，學名就被命名為“雙葉鈴木龍”了。鈴木發現化石時還是高中生，到最終命名為止經過了30多年……在考古學的世界裡，發掘當然不用說，要證明新發掘的東西是否與現存的都不同，也是一樁很辛苦的事情哦~嗯，大部分的研究者在證明方面都有自己擅長的領域！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/5/53/tl7g6ref08fax0sfbcknlco56xvjtn7.png/120px-%E3%83%95%E3%82%BF%E3%83%90%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["大眼魚龍的頭", "ophthalmo skull", "オフタルモサウルスのあたま", "2500", "大眼魚龍啊，出現在恐龍時代最開始的時候。順便說一下，它不是恐龍，而是生活在海裡的爬行動物……最吸引人的地方就是那海豚般的身形和大大的眼睛！多虧了那眼睛，它的視力非常好，即便是在黑暗的地方狩獵，也是得心應手的！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/4/43/h76te1vhsc26cezhwhq7aw2lv9az88f.png/120px-%E3%82%AA%E3%83%95%E3%82%BF%E3%83%AB%E3%83%A2%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png"], ["大眼魚龍的身體", "ophthalmo torso", "オフタルモサウルスのからだ", "2000", "大眼魚龍啊，出現在恐龍時代最開始的時候。順便說一下，它不是恐龍，而是生活在海裡的爬行動物……最吸引人的地方就是那海豚般的身形和大大的眼睛！多虧了那眼睛，它的視力非常好，即便是在黑暗的地方狩獵，也是得心應手的！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/c/c3/7me53kavn1i18l4vk1girvvojs4guk8.png/120px-%E3%82%AA%E3%83%95%E3%82%BF%E3%83%AB%E3%83%A2%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["大角鹿的右半身", "right megalo side", "メガロケロスのみぎはんしん", "5500", "大角鹿啊，是生活在恐龍之後的冰河期的生物，是鹿的同類。雖然它的學名“Megaloceros giganteus”聽起來很像恐龍。但意思是“擁有大角的鹿”哦。顧名思義，這是一種擁有巨大鹿角的大型鹿，鹿角的寬度能達到3米以上哦！與恐龍相比體型小了很多，但很容易和現代動物進行比較，一想像起那姿態就令人激動不已呢！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/6/6c/t840bxusnli1mtl8ywk2kgnecmrcry5.png/120px-%E3%83%A1%E3%82%AC%E3%83%AD%E3%82%B1%E3%83%AD%E3%82%B9%E3%81%AE%E3%81%BF%E3%81%8E%E3%81%AF%E3%82%93%E3%81%97%E3%82%93.png.jpeg"], ["大角鹿的左半身", "left megalo side", "メガロケロスのひだりはんしん", "4000", "大角鹿啊，是生活在恐龍之後的冰河期的生物，是鹿的同類。雖然它的學名“Megaloceros giganteus”聽起來很像恐龍。但意思是“擁有大角的鹿”哦。顧名思義，這是一種擁有巨大鹿角的大型鹿，鹿角的寬度能達到3米以上哦！與恐龍相比體型小了很多，但很容易和現代動物進行比較，一想像起那姿態就令人激動不已呢！ ", "https://patchwiki.biligame.com/images/dongsen/e/e5/nz3i8sa4ko10hy33qx9wno1sowvskbm.png"], ["奇蝦", "anomalocaris", "アノマロカリス", "2000", "奇蝦啊，是生活在比恐龍時代更早時期的水中生物，因極具個性的樣子而為人所知。扁平的身體全場可達100厘米，那好像蜻蜓一樣突起的眼睛，頭頂那像蝦尾一般的觸鬚……因為這奇特的樣子，在很長一段時間裡都被認為是好幾種生物重疊在一起的化石哦。還有，奇蝦這個名字本身就是“奇怪的蝦”的意思……即使是從這個名字，也能感覺到當時的混亂呢。 ", "https://patchwiki.biligame.com/images/dongsen/b/b0/ny7p1h8cntsqmqekcu1etn50jpkg9ju.png"], ["始祖鳥", "archaeopteryx", "しそちょう", "1300", "始祖鳥啊，從羽毛和外表來看，曾被認為是鳥類的祖先……但實際好像沒有直接關係哦。並不是我的祖先。每當有新的化石被發現，就會眾說紛紜，因為是還有很多謎團的生物哦！ ", "https://patchwiki.biligame.com/images/dongsen/0/08/gzwlbhpov75pma9w3ogwo2cor2tpf7d.png"], ["巨角犀的頭", "megacero skull", "メガセロプスのあたま", "4500", "巨角犀啊，顯著特徵就是鼻子上的大角，是很像犀牛的食草恐龍！雖說很相似，但是身體長度超過了4米……簡直就像岩石一樣呢！另一方面牙齒非常小，只能吃非常柔嫩的草。因為飲食方面的局限，最終走向了滅絕的道路……感覺有點不中用呢。不過，這也真的是很可憐啊！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/9/99/hpnwz0yu7tmrm0p9eei5bbw98os45ne.png/120px-%E3%83%A1%E3%82%AC%E3%82%BB%E3%83%AD%E3%83%97%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["巨角犀的尾巴", "megacero tail", "メガセロプスのしっぽ", "3000", "巨角犀啊，顯著特徵就是鼻子上的大角，是很像犀牛的食草恐龍！雖說很相似，但是身體長度超過了4米……簡直就像岩石一樣呢！另一方面牙齒非常小，只能吃非常柔嫩的草。因為飲食方面的局限，最終走向了滅絕的道路……感覺有點不中用呢。不過，這也真的是很可憐啊！ ", "https://patchwiki.biligame.com/images/dongsen/e/e7/sch2p24g47tic238xsfcn03okllnsod.png"], ["巨角犀的身體", "megacero torso", "メガセロプスのからだ", "3500", "巨角犀啊，顯著特徵就是鼻子上的大角，是很像犀牛的食草恐龍！雖說很相似，但是身體長度超過了4米……簡直就像岩石一樣呢！另一方面牙齒非常小，只能吃非常柔嫩的草。因為飲食方面的局限，最終走向了滅絕的道路……感覺有點不中用呢。不過，這也真的是很可憐啊！ ", "https://patchwiki.biligame.com/images/dongsen/1/15/05y0a17o77m56kj2fjryh5h5b8aiqdu.png"], ["帝龜的頭", "archelon skull", "アーケロンのあたま", "4000", "帝龜啊，是目前發現的海龜中體型最大的。主食是海藻、魷魚、章魚，從所處年代來考慮，或許還吃過，菊石哦！因為全長有4米……殼的大小，不是正好和汽車差不多嘛！乘在那麼大的背上一起游泳的話，心情一定會很好吧~雖然被水弄濕很糟糕……", "https://patchwiki.biligame.com/images/dongsen/thumb/0/04/sbtqyg0nuwphyze0crvroyv01lggyo9.png/120px-%E3%82%A2%E3%83%BC%E3%82%B1%E3%83%AD%E3%83%B3%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["帝龜的身體", "archelon tail", "アーケロンのからだ", " 3500", "帝龜啊，是目前發現的海龜中體型最大的。主食是海藻、魷魚、章魚，從所處年代來考慮，或許還吃過，菊石哦！因為全長有4米……殼的大小，不是正好和汽車差不多嘛！乘在那麼大的背上一起游泳的話，心情一定會很好吧~雖然被水弄濕很糟糕……", "https://patchwiki.biligame.com/images/dongsen/6/60/pxfwq9vzld0colk8v2xaim4297d2j29.png"], ["異齒龍的頭", "dimetrodon skull", "ディメトロドンのあたま", "5500", "異齒龍啊，是在比恐龍時代稍早的時候出現的大型蜥蜴。它會使用背上那好像大大的帆一樣的器官，能比一般的蜥蜴更自由地調節自身的體溫。這麼說的話......在異齒龍的時代，哺乳類的祖先就和恐龍分開來了，異齒龍更偏哺乳類啊......嗯，這麼想的話，比起恐龍，不知為何感覺更親近了，不可思議啊。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/f/fe/ib6jqnrgolx2myep4i6ehfvniwcbxg1.png/120px-%E3%83%87%E3%82%A3%E3%83%A1%E3%83%88%E3%83%AD%E3%83%89%E3%83%B3%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["異齒龍的身體", "dimetrodon torso", "ディメトロドンのからだ", "5000", "異齒龍啊，是在比恐龍時代稍早的時候出現的大型蜥蜴。它會使用背上那好像大大的帆一樣的器官，能比一般的蜥蜴更自由地調節自身的體溫。這麼說的話……在異齒龍的時代，哺乳類的祖先就和恐龍分開來了，異齒龍更偏哺乳類啊……嗯，這麼想的話，比起恐龍，不知為何感覺更親近了，不可思議啊。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/c/c0/bdo0lms3w8uv9wodulj8zguq0wcopxx.png/120px-%E3%83%87%E3%82%A3%E3%83%A1%E3%83%88%E3%83%AD%E3%83%89%E3%83%B3%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["恐爪龍的頭", "deinony torso", "ディノニクスのあたま", "3000", "恐爪龍啊，是在恐龍時代最後登場的小型食肉恐龍。確實是恐龍，這點錯不了，但骨骼形狀擁有類似鳥的特徵，前腳被羽毛覆蓋著……“鳥的祖先是由恐龍進化而來”這一學說就是它支持的，直至今日，相關研究還在繼續著哦。我作為鳥的一份子，也是不可忽視的存在。 ", "https://patchwiki.biligame.com/images/dongsen/1/18/6uvb404ac3q1i7npi6oh0onflz137mb.png"], ["恐爪龍的尾巴", "deinony tail", "ディノニクスのしっぽ", "2500", "", "https://patchwiki.biligame.com/images/dongsen/thumb/7/73/1njtfmm36d1iotixpg6a11v900kkass.png/120px-%E3%83%87%E3%82%A3%E3%83%8E%E3%83%8B%E3%82%AF%E3%82%B9%E3%81%AE%E3%81%97%E3%81%A3%E3%81%BD.png.jpeg"], ["恐龍腳印化石", "dinosaur track", "あしあとのかせき", " 1000", "恐龍腳印化石啊，是留在海底或沙漠等柔軟土地上的腳印所形成的的化石。從這個化石可以了解到該生物的活動範圍和種群關係……最近，連身長、步伐、走路速度等也能推斷出來了！可以切身地感受到恐龍時代的日常片段，你不覺得這是很重要的資料嗎？ ", "https://patchwiki.biligame.com/images/dongsen/thumb/6/6a/cyf210c95z4ld7kdxyxj9u3uhf07cz5.png/120px-%E3%81%82%E3%81%97%E3%81%82%E3%81%A8%E3%81%AE%E3%81%8B%E3%81%9B%E3%81%8D.png.jpeg"], ["新翼魚", "eusthenopteron", "ユーステノプテロン", "2000", "", "https://patchwiki.biligame.com/images/dongsen/thumb/5/5e/f0vt15l19l85rgff3m5pc1ofqmwren5.png/120px-%E3%83%A6%E3%83%BC%E3%82%B9%E3%83%86%E3%83%8E%E3%83%97%E3%83%86%E3%83%AD%E3%83%B3.png.jpeg"], ["無齒翼龍的右翼", "right ptera wing", "プテラノドンのうよく", "4500", "無齒翼龍啊，是出現在恐龍時代末期的恐龍。雖然會在空中飛行，但其實，並非鳥類，而是爬行動物哦！展開雙翼的話，大小可以媲美小型飛機……但體重還不到20公斤！作為同樣有翅膀的，我對它的控制力甘拜下風……", "https://patchwiki.biligame.com/images/dongsen/thumb/e/e0/swu5lc9f0wd1oh65w254bvv26elvkd7.png/120px-%E3%83%97%E3%83%86%E3%83%A9%E3%83%8E%E3%83%89%E3%83%B3%E3%81%AE%E3%81%86%E3%82%88%E3%81%8F.png.jpeg"], ["無齒翼龍的頭", "ptera body", "プテラノドンのあたま", "4000", "無齒翼龍啊，是出現在恐龍時代末期的恐龍。雖然會在空中飛行，但其實，並非鳥類，而是爬行動物哦！展開雙翼的話，大小可以媲美小型飛機……但體重還不到20公斤！作為同樣有翅膀的，我對它的控制力甘拜下風……", "https://patchwiki.biligame.com/images/dongsen/e/ed/1er4u70a0408yf0ayk219j9seh3er1k.png"], ["無齒翼龍的左翼", "left ptera wing", "プテラノドンのさよく", "4500", "無齒翼龍啊，是出現在恐龍時代末期的恐龍。雖然會在空中飛行，但其實，並非鳥類，而是爬行動物哦！展開雙翼的話，大小可以媲美小型飛機……但體重還不到20公斤！作為同樣有翅膀的，我對它的控制力甘拜下風……", "https://patchwiki.biligame.com/images/dongsen/8/83/5os420qxywkvclkizzbhlmidv15fvh9.png"], ["暴龍的頭", "T. rex skull", "Tレックスのあたま", "6000", "暴龍啊，是生存到恐龍時代最後期的最大食肉恐龍！它用巨大的下顎和鋒利的牙齒咬碎獵物，簡直是站在食物鏈的頂端！ ！雖然大家都這麼想啦……但也有說法，因為體重非常大，而無法敏捷地行動~即便是被襲擊了，也有可能僥倖逃脫哦。 （我可不想被它追……）", "https://patchwiki.biligame.com/images/dongsen/e/ec/akbawif5lncn15nogoylva5d3hn8dkk.png"], ["暴龍的尾巴", "T. rex tail", "Tレックスのしっぽ", "5000", "暴龍啊，是生存到恐龍時代最後期的最大食肉恐龍！它用巨大的下顎和鋒利的牙齒咬碎獵物，簡直是站在食物鏈的頂端！ ！雖然大家都這麼想啦……但也有說法，因為體重非常大，而無法敏捷地行動~即便是被襲擊了，也有可能僥倖逃脫哦。 （我可不想被它追……）", "https://patchwiki.biligame.com/images/dongsen/8/8e/fjux4v4moa8zt9fpzq694lyppeejg8s.png"], ["暴龍的身體", "T. rex torso", "Tレックスのからだ", "5500", "暴龍啊，是生存到恐龍時代最後期的最大食肉恐龍！它用巨大的下顎和鋒利的牙齒咬碎獵物，簡直是站在食物鏈的頂端！ ！雖然大家都這麼想啦……但也有說法，因為體重非常大，而無法敏捷地行動~即便是被襲擊了，也有可能僥倖逃脫哦。 （我可不想被它追……）", "https://patchwiki.biligame.com/images/dongsen/thumb/9/95/3army50xsvejg1rm634yurdikfi7gzh.png/120px-T%E3%83%AC%E3%83%83%E3%82%AF%E3%82%B9%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["梁龍的頭", "diplo skull", "ディプロドクスのあたま", "5000", "梁龍啊，是目前發現的恐龍之中體型最大的食草恐龍。即使是在同樣大型的恐龍中，它的尾巴也格外得長，能像鞭子一樣揮舞著驅趕敵人！嗯，從頭部到尾巴尖好像有20米……在其他方面也是壓倒性的呢。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/1/14/5tx26ri3j15jvua0a88ncpijk6pai1n.png/120px-%E3%83%87%E3%82%A3%E3%83%97%E3%83%AD%E3%83%89%E3%82%AF%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jp