], ["棘龍的頭", "spino skull", "スピノサウルスのあたま", "4000", "棘龍啊，是體型可以與那著名的暴龍相媲美的食肉恐龍！它像現在的鱷魚一樣生活在水邊，以鯊魚或鰩魚為食。主食是鯊魚……一聽到這個，就再次真切地感受到了它的兇殘！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/4/4c/3qma1hahpusi6znib0oh5lbaxxq29i6.png/120px-%E3%82%B9%E3%83%94%E3%83%8E%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png"], ["棘龍的尾巴", "spino tail", "スピノサウルスのしっぽ", "2500", "棘龍啊，是體型可以與那著名的暴龍相媲美的食肉恐龍！它像現在的鱷魚一樣生活在水邊，以鯊魚或鰩魚為食。主食是鯊魚……一聽到這個，就再次真切地感受到了它的兇殘！ ", "https://patchwiki.biligame.com/images/dongsen/3/3a/tek0fvzfgncea8ig2rnljwheqf2b77q.png"], ["棘龍的身體", "spino torso", "スピノサウルスのからだ", "3000", "棘龍啊，是體型可以與那著名的暴龍相媲美的食肉恐龍！它像現在的鱷魚一樣生活在水邊，以鯊魚或鰩魚為食。主食是鯊魚……一聽到這個，就再次真切地感受到了它的兇殘！ ", "https://patchwiki.biligame.com/images/dongsen/b/b7/ixugwoao9ymguvz2v1e9zb9ee6c673f.png"], ["琥珀", "amber", "コハク", "1200", "琥珀啊，是遠古時代樹的汁液凝固形成的。因為其美麗，從古代起就被人們當做寶石來交易。但是，因為裡面封存了古代的蟲子和植物，在學術上也具有很高的價值哦。作為了解恐龍生存時代的貴重線索，而來到了博物館！ ", "https://patchwiki.biligame.com/images/dongsen/4/4b/8ohrsbiaznz67chjh3jemwgscqffiau.png"], ["甲龍的頭", "ankylo skull", "アンキロサウルスのあたま", "3500", "甲龍啊，從頭部到背部都佈滿了像鎧甲一樣的尖刺哦。身體佈滿了食草恐龍式的防禦，相當帥氣……但也能用錘子般的尾巴和食肉恐龍進行對抗！在現代的學說裡，人們認為與其說是對抗，這更像是種積極的攻擊……這完全推翻了至今為止食草恐龍給世人留下的印象，真讓人吃驚！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/c/ca/6qb5i0ypxgkepfys72t4jocsklh5fie.png/120px-%E3%82%A2%E3%83%B3%E3%82%AD%E3%83%AD%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["甲龍的尾巴", "ankylo tail", "アンキロサウルスのしっぽ", "2500", "甲龍啊，從頭部到背部都佈滿了像鎧甲一樣的尖刺哦。身體佈滿了食草恐龍式的防禦，相當帥氣……但也能用錘子般的尾巴和食肉恐龍進行對抗！在現代的學說裡，人們認為與其說是對抗，這更像是種積極的攻擊……這完全推翻了至今為止食草恐龍給世人留下的印象，真讓人吃驚！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/5/57/pzh5dnz9c2dnskprb6t0c93rk8s40rl.png/120px-%E3%82%A2%E3%83%B3%E3%82%AD%E3%83%AD%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%97%E3%81%A3%E3%81%BD.png.jpeg"], ["甲龍的身體", "ankylo torso", "アンキロサウルスのからだ", "3000", "甲龍啊，從頭部到背部都佈滿了像鎧甲一樣的尖刺哦。身體佈滿了食草恐龍式的防禦，相當帥氣……但也能用錘子般的尾巴和食肉恐龍進行對抗！在現代的學說裡，人們認為與其說是對抗，這更像是種積極的攻擊……這完全推翻了至今為止食草恐龍給世人留下的印象，真讓人吃驚！ ", "https://patchwiki.biligame.com/images/dongsen/8/8d/obct1y2z8zu3ucohhhmum40xt8m1g4e.png"], ["禽龍的頭", "iguanodon skull", "イグアノドンのあたま", "4000", "禽龍啊，其顯著特徵是那矛一樣的爪子。是中型的食草恐龍。那又尖又長的爪子和鳥類的尖爪非常相似，因而以此命名。平常基本是四腳行走的，但在吃東西或是緊急情況下，也會用兩隻腳走路！據說會用爪子對抗肉食恐龍的攻擊。作為食草恐龍，應該算是行動相當敏捷的恐龍吧！ ", "https://patchwiki.biligame.com/images/dongsen/d/d3/cgsw4baiufhe64enitde6d0sksxyifz.png"], ["禽龍的尾巴", "iguanodon tail", "イグアノドンのしっぽ", "3000", "禽龍啊，其顯著特徵是那矛一樣的爪子。是中型的食草恐龍。那又尖又長的爪子和鳥類的尖爪非常相似，因而以此命名。平常基本是四腳行走的，但在吃東西或是緊急情況下，也會用兩隻腳走路！據說會用爪子對抗肉食恐龍的攻擊。作為食草恐龍，應該算是行動相當敏捷的恐龍吧！ ", "https://patchwiki.biligame.com/images/dongsen/9/99/29vazwtv7pkgkiqcu6xso0i13m1upjs.png"], ["禽龍的身體", "iguanodon torso", "イグアノドンのからだ", "3500", "禽龍啊，其顯著特徵是那矛一樣的爪子。是中型的食草恐龍。那又尖又長的爪子和鳥類的尖爪非常相似，因而以此命名。平常基本是四腳行走的，但在吃東西或是緊急情況下，也會用兩隻腳走路！據說會用爪子對抗肉食恐龍的攻擊。作為食草恐龍，應該算是行動相當敏捷的恐龍吧！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/2/2c/k8orv0it3eac3xype8mlp25kd2f8jo8.png/120px-%E3%82%A4%E3%82%B0%E3%82%A2%E3%83%8E%E3%83%89%E3%83%B3%E3%81%AE%E3%81%8B%E3%82%89%E3%81%A0.png.jpeg"], ["糞化石", "coprolite", "ウンコのかせき", "1100", "糞化石啊，是研究化石時不可或缺的信息寶庫！比如，在食草恐龍的糞化石中混雜著小石子……由此可以了解到，該恐龍將植物和小石子整個吞下，通過在肚子裡互相摩擦幫助消化的事實！不只是食物的種類，還能了解吃的方式，真的很厲害呢！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/3/32/g47zq96mschro5fi7a00003hg7wu7bw.png/120px-%E3%82%A6%E3%83%B3%E3%82%B3%E3%81%AE%E3%81%8B%E3%81%9B%E3%81%8D.png.jpeg"], ["腕龍的頭", "brachio skull", "ブラキオサウルスのあたま", "6000", "", "https://patchwiki.biligame.com/images/dongsen/thumb/0/02/hvkr98htsxymvupzxsbr4pecyctjkhi.png/120px-%E3%83%96%E3%83%A9%E3%82%AD%E3%82%AA%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["腕龍的尾巴", "brachio tail", "ブラキオサウルスのしっぽ", "5500", "腕龍啊，是出現在恐龍時代中期，擁有手腕蜥蜴之稱的巨大食草恐龍。因為擁有比後腳長很多的前腳，即便在長脖子的食草恐龍里，它也能吃到位置特別高的植物。嗯，為了維持那巨大的身體，據說必須一整天都不停地吃……因為這巨大的體格，直至今日仍不斷有學說出現，是非常具有深意的恐龍。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/b/b6/ec95zzloo0qjz7y80ezyo7nydxg2dqv.png/120px-%E3%83%96%E3%83%A9%E3%82%AD%E3%82%AA%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%97%E3%81%A3%E3%81%BD.png.jpeg"], ["腕龍的胸部", "brachio chest", "ブラキオサウルスのむね", "5500", "腕龍啊，是出現在恐龍時代中期，擁有手腕蜥蜴之稱的巨大食草恐龍。因為擁有比後腳長很多的前腳，即便在長脖子的食草恐龍里，它也能吃到位置特別高的植物。嗯，為了維持那巨大的身體，據說必須一整天都不停地吃……因為這巨大的體格，直至今日仍不斷有學說出現，是非常具有深意的恐龍。 ", "https://patchwiki.biligame.com/images/dongsen/c/c3/a1bbw5jpdyy67xy8s2e5lxh487d4xbq.png"], ["腕龍的腰部", "brachio pelvis", "ブラキオサウルスのこし", "5000", "腕龍啊，是出現在恐龍時代中期，擁有手腕蜥蜴之稱的巨大食草恐龍。因為擁有比後腳長很多的前腳，即便在長脖子的食草恐龍里，它也能吃到位置特別高的植物。嗯，為了維持那巨大的身體，據說必須一整天都不停地吃……因為這巨大的體格，直至今日仍不斷有學說出現，是非常具有深意的恐龍。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/2/27/br3muo2g2arfodwbyq7f3ljdyv7f9d2.png/120px-%E3%83%96%E3%83%A9%E3%82%AD%E3%82%AA%E3%82%B5%E3%82%A6%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%93%E3%81%97.png.jpeg"], ["菊石", "ammonite", "アンモナイト", "1100", "菊石啊，曾在漫長的恐龍時代繁盛一時，是螺的一員。根據時代的不同，貝殼的花紋也不同，因此經常被用來研究地層的年代哦。簡直就是考古界的著名嚮導！小小的貝殼中，也充滿了故事呢！ ", "https://patchwiki.biligame.com/images/dongsen/9/9a/mxuu7n3ovyom8mwutsjbowdf1le1e83.png"], ["鄧氏魚", "dunkleosteus", "ダンクルオステウス", "3500", "鄧氏魚啊，是活躍在比恐龍更早時期的魚的伙伴，應該是……不過呢… …因為只發現了從頭部到肩部的化石，所以軀幹的樣子只能靠想像。說不定，那用鎧甲般骨頭守護的兇惡臉孔下，卻擁有著讓人意想不到的可愛身形……嗯，這諸多的謎團，正是鄧氏魚深受粉絲喜愛的地方啊！ ", "https://patchwiki.biligame.com/images/dongsen/4/44/kzskxztrt4w4b80w9u6s3etemjkwsqf.png"], ["長毛象的頭", "mammoth skull", "マンモスのあたま", "3000", "長毛像啊，擁有巨大的牙齒和長長的體毛，是很像大象的動物。雖然很相似，但卻並非現代象的直系祖先！而且，即使被統稱為長毛象，其實也分很多種類……從體型比現代像小的種類，到體長超過5米的，存在過各種各樣的大小！在已滅絕的動物中，是生存時間離現在最近的，因此也曾發現過被冰封的長毛象哦。雖然毫無疑問是遠古時期的生物……但總感覺離我們很近呢！ ", "https://patchwiki.biligame.com/images/dongsen/thumb/e/e0/bqi70cri43en1jml0qdiusb90alp3fk.png/120px-%E3%83%9E%E3%83%B3%E3%83%A2%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["長毛象的身體", "mammoth torso", "マンモスのからだ", "2500", "長毛像啊，擁有巨大的牙齒和長長的體毛，是很像大象的動物。雖然很相似，但卻並非現代象的直系祖先！而且，即使被統稱為長毛象，其實也分很多種類……從體型比現代像小的種類，到體長超過5米的，存在過各種各樣的大小！在已滅絕的動物中，是生存時間離現在最近的，因此也曾發現過被冰封的長毛象哦。雖然毫無疑問是遠古時期的生物……但總感覺離我們很近呢！ ", "https://patchwiki.biligame.com/images/dongsen/4/42/3tpn17ecyobv8ghui4a9jnyyuys8hnm.png"], ["風神翼龍的右翼", "right quetzal wing", "ケツァルコアトルスのうよく", "5000", "風神翼龍啊，是支配恐龍時代的天空直到最後時刻的，史上最大級別的翼龍。展開翅膀的樣子不必說，就連站在地面時，也比現代的長頸鹿大……最近，還發現了腳印的化石，已經了解它是用四足行走的。在那翱翔天空的酷帥的形象背後，行走方式卻相當接地氣……感覺好好笑呢。 ", "https://patchwiki.biligame.com/images/dongsen/7/79/i7b134dss2b98357xurfhgnya3ptcnh.png"], ["風神翼龍的頭", "quetzal torso", "ケツァルコアトルスのあたま", "4500", "風神翼龍啊，是支配恐龍時代的天空直到最後時刻的，史上最大級別的翼龍。展開翅膀的樣子不必說，就連站在地面時，也比現代的長頸鹿大……最近，還發現了腳印的化石，已經了解它是用四足行走的。在那翱翔天空的酷帥的形象背後，行走方式卻相當接地氣……感覺好好笑呢。 ", "https://patchwiki.biligame.com/images/dongsen/thumb/5/50/1byblmi971bx3mzojk75cudqgqsqms4.png/120px-%E3%82%B1%E3%83%84%E3%82%A1%E3%83%AB%E3%82%B3%E3%82%A2%E3%83%88%E3%83%AB%E3%82%B9%E3%81%AE%E3%81%82%E3%81%9F%E3%81%BE.png.jpeg"], ["風神翼龍的左翼", "left quetzal wing", "ケツァルコアトルスのさよく", "5000", "風神翼龍啊，是支配恐龍時代的天空直到最後時刻的，史上最大級別的翼龍。展開翅膀的樣子不必說，就連站在地面時，也比現代的長頸鹿大……最近，還發現了腳印的化石，已經了解它是用四足行走的。在那翱翔天空的酷帥的形象背後，行走方式卻相當接地氣……感覺好好笑呢。 ", "https://patchwiki.biligame.com/images/dongsen/a/a7/8xsjx1p5yfyc4fea4uewemyj7dtvi2t.png"], ["鯊魚牙齒化石", "shark-tooth pattern", "サメのはのかせき", "1000", "鯊魚牙齒化石啊，被認為是旋齒鯊這種古代鯊魚下顎部位的牙齒… …那螺旋狀排列的形狀特別的牙齒究竟是以何種方式長在下顎部位，至今尚無定論。別看鯊魚這樣，它全身除了牙齒以外，全部是由被稱為軟骨的柔軟骨頭組成，所以不會留下身體的化石呢……這簡直可以說是測試研究者想像力的夢幻般的存在！", "https://patchwiki.biligame.com/images/dongsen/1/1a/oo92yhcjofq1b7tjbrff4hbm3jiml0p.png"]]

